import React from "react";
import "./style.css";
import Form from "../form/Form";
function Dropdown() {
  const whichone = "";
  const buuz = (whichone) => {
    if (whichone === "N") {
      document.getElementById("14").value = "Y";
    } else {
      document.getElementById("14").value = "N";
    }
  };
  return (
    <div class="dropdown">
      <Form class="dropbtn" placeholder="genToken" id="14">
        GenToken
      </Form>
      <div class="dropdown-content">
        <a onClick={buuz("Y")}>Y</a>
        <a onClick={buuz("N")}>N</a>
      </div>
    </div>
  );
}

export default Dropdown;
